import axios from "axios";
import React, { useEffect, useState } from "react";

const Inicio = () => {
  const [data, setdata] = useState();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const respuesta = await axios.get("http://localhost:3000/users");
        setdata(respuesta);
      } catch (error) {
        console.log("error");
      }
    };
    fetchData();
  }, []);

  return (
    <div className=" box-border bg-gradient-to-r from-blue-800 to-blue-400 w-screen h-screen  ">
      <div className=" flex flex-col gap-7 h-3/6 justify-center items-center  ">
        <h1 className=" bg-clip-text text-transparent text-6xl font-extrabold bg-gradient-to-r from-pink-500 to-orange-500">
          Lista de Usuarios
        </h1>

        <table className=" bg-slate-50 w-[80%]  font-sans rounded-md p-6 shadow-2xl shadow-white opacity-1 ">
          Table
        </table>
      </div>
    </div>
  );
};
export default Inicio;
